const customer = {};

customer.create = async (username, password) => {

  const datapost = {
    username: username,
    password: password,
  }

  const res = await fetch("http://localhost:8080/foodpanda/customer",{method : GET, body : JSON.stringify(datapost)})
  .then(response=>{ return response.data; })
  .catch(error=>{ return error.response; })
  
  return res;
}

export default customer
